import React from 'react';

function DisplayLink(props) {

    let style = {
        border: "red solid 1px",
    }

     if (props.list.length > 0){
         return (
             props.list.map((link)=>{
                return (
                <div style = {style} key={link.id}>
                    <a href={link.url}>{link.url}</a>
                </div>)
             })
         )
     }

}

export default DisplayLink;
